import {
    IonButtons,
    IonButton,
    IonModal,
    IonHeader,
    IonContent,
    IonToolbar,
    IonTitle,

} from "@ionic/react";
import React, { useState, useEffect } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Typography from '@mui/material/Typography';
import Modal from '@mui/material/Modal';
import Button from '@mui/material/Button';
const style = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: 400,
    bgcolor: 'background.paper',
    border: '2px solid #000',
    boxShadow: 24,
    p: 4,
};
const TopicFrom: React.FC<{
    open: boolean
    handleClose: any
}> = (props) => {


    return (
        <div>

            <Modal
                open={props.open}
                onClose={props.handleClose}
                aria-labelledby="modal-modal-title"
                aria-describedby="modal-modal-description"
            >
                <Box sx={style}>
                    <Button onClick={props.handleClose} variant="text">X</Button>
                    <Typography sx={{ mt: 3 }} id="modal-modal-title" variant="h6" component="h2">
                        Add Topic
                    </Typography>
                    <TextField sx={{ mt: 3 }}
                        type="text"
                        label="Topic Name"
                        variant="filled"
                        focused />
                    <TextField sx={{ mt: 3 }}
                        type="file"
                        label="Topic File"
                        variant="filled"
                        focused />
                    <Button sx={{ mt: 3 }} variant="outlined">Outlined</Button>
                </Box>
            </Modal>
        </div>
    );
}
export default TopicFrom;
